import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="mihawk.jpg" className="App-logo" alt="logo" />
        <p>
          COUCOU
        </p>
      </header>
    </div>
  );
}

export default App;
